import { useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { getPokemons , getPokemonsAttack } from '../store/actions'
import PokemonsCard from './PokemonsCard'
import { Link } from 'react-router-dom'

export default function PokemonsCards() {
    let allPokemons = useSelector((state) => state.pokemons)
    let dispatch = useDispatch()
    useEffect(() => {
        dispatch(getPokemonsAttack())
    }, [dispatch])
    let id = allPokemons.
   
  return (
        <div>
          {
            allPokemons.map(pokemons => 
            <PokemonsCard 
              id={pokemons.id}
              name={pokemons.name} 
              image={pokemons.image} 
              type={pokemons.type}/>
            )
          }  

          {<Link to ='/details/'><button> Next </button></Link> }
          <button> Previus </button>   
        </div>
  )
   
}
